    [],nt"revision_timestamp": "2016-07-16T01:33:26.269288",nt"name": "fire-restriction-areas",nt"isopen":
    false,nt"url": null,nt"notes": "The Fire Restriction Areas represents a
    geographic location with similar timing for weather changes and resulting fire behavior
    potentials. Boundaries for each area generally follow county boundaries with some
    being placed along roadways, rivers, hydrologic divides or other known points that
    can be clearly described to the public and agency personnel. When a majority of
    land managers and agency administrators representing the jurisdictions within an
    area agree that the conditions warrant a restriction, the entire area will be placed
    in a restricted status. When land managers and agency administrators agree that
    the restrictions for that area can be removed, the entire area will rescind restrictions
    as a whole.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
